import React, { Component } from "react";
import { NavLink } from "react-router-dom";

import Header from "./components/Header.js";
import FilterNav from "./components/FilterNav.js";

import "./App.css";

class App extends Component {
  render() {
    return (
      <section className="App">
        <nav className="header">
          <div className="menu-container">
            <NavLink className="header-menu-text" exact to="/">
              LOGO
            </NavLink>
            <div className="searchheader">
              <NavLink to="/filter1">Women</NavLink>
              <NavLink to="/Filter2">Men</NavLink>
              <NavLink to="/Filter3">Other</NavLink>
            </div>
          </div>
        </nav>

        <FilterNav className="articles-table" />
      </section>
    );
  }
}

export default App;
